import React from 'react';

const KeyQualifications = () => {
    return (
        <section id="key-qualifications">
            <h2>Key Qualifications</h2>
            <ul>
                <li>Strong understanding of CS data structures and algorithms.</li>
                <li>In-depth knowledge of microservices architecture using Spring Boot, improving system modularity and ease of maintenance.</li>
                <li>Proficient in developer tooling across the software development lifecycle.</li>
                <li>Excellent problem-solving abilities and strong oral and written communication skills.</li>
                <li>Ability to excel in fast-paced, startup-like environments.</li>
                <li>Experience with architecture and design patterns, reliability, and scaling of systems.</li>
                <li>Proven track record in delivering high-quality technology products and services.</li>
            </ul>
        </section>
    );
};

export default KeyQualifications;
